import styled from "styled-components"

function ChatMessage() {
    return (
        <Container>
            <UserAvatar>

            </UserAvatar>
            <MessageContent>
                <Name>
                    
                </Name>
                <Text>

                </Text>
            </MessageContent>
        </Container>
    )
}

export default ChatMessage

const Container= styled.div`
padding: 9px 20px;
display: flex;
align-items: center
`
const UserAvatar= styled.div`
width: 36px;
height: 36px;
border-radius: 2px;
overflow: hidden;
margin-right: 8px
img{
    width: 100%
}
`
const MessageContent= styled.div`
display: flex
flex-direction: column

`
const Name= styled.span`
font-weight: 900;
font-size: 15px;
line-height: 1.4;
span{
    margin-left: 8px;
    font-weight: 400;
    color: rgb(97,96,97);
    font-size: 13px
}
`
const Text= styled.div`

`
